import React from 'react';

import Button from '@mui/material/Button';
import { styled } from '@mui/material/styles';
import theme from "../UI/Theme";

import WrapperNoColor from '../components/UI/WrapperNoColor';
import Wrapper from '../components/UI/Wrapper';

const ContainedButton = styled(Button)({
  ...theme.typography.buttonCustomization,
  color: "white",
  boxShadow: "none"
})

const OutlinedButton = styled(Button)({
  ...theme.typography.buttonCustomization
})

const InnovationLab = () => {
  return (
    <React.Fragment>
    <WrapperNoColor></WrapperNoColor>
    <Wrapper>
      <h3>Ready to get started?</h3>
      <p>Sign up or contact us</p>
      <ContainedButton variant="contained" color="secondary">Log In</ContainedButton>
      <OutlinedButton variant="outlined" color="secondary">Sign Up</OutlinedButton>
    </Wrapper>
    </React.Fragment>
  )
};

export default InnovationLab;
